import React from 'react';
import "./Home.css";
import { Link } from "react-router-dom";
import bitcoin from "../images/bitcoin.png";
import etherum from "../images/etherum.png";
import realestate from "../images/realestate.jpg"

const Home = () => {
  return (
    <div>
      <h1>Investment Securities</h1>
      <p>If you want to make money and get richer , invest your money in cryptocurrencies, stocks, real estate, bonds, and other securities. Maybe you need technical advice on where, how and when to invest. LisaConsult is here for you to make your dream come true. Just click the link below to sign up for the course and you will have an amazing life.</p>
    </div>
  )
}

export default Home
